import React, { useState } from "react";
import Aux from "../../HOC_AUX/Aux/Aux";
import Sidebar from "../Containers/Sidebar/Sidebar";
import classes from "./Layout.module.css";
import Contentholder from "../Containers/Contentholder/Contentholder";

function Layout(props) {
  let storedValue;

  const [currentHeader, changeHeader] = useState("home");

  let headerClickHandler = (event) => {
    storedValue = event.target.innerText.toLowerCase();
    console.log(storedValue);
    changeHeader(storedValue);
  };

  return (
    <div className={classes.Layout}>
      <Sidebar onHeaderClick={headerClickHandler} />
      <Contentholder storedHeader={storedValue} />
    </div>
  );
}

export default Layout;
